import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div class="ui secondary pointing menu">
        <a class="active item">Home</a>
        <a class="item">Messages</a>
        <a class="item">Friends</a>
        <div class="right menu">
          <a class="ui item">Logout</a>
        </div>
      </div>
      <div class="ui segment">
        <p></p>
      </div>
    </div>
  );
}

export default App;
